import './LandCard.css'
import React from 'react'

export default function LandCard(props) {

    const {name, image, address} = props.data;

    return (
        <>
            <div className="land-card-body">
                <div id='card-heading'>
                    <h2>{name}</h2>
                </div>
                <div id='card-image'></div>
            </div>
        </>
    )
}
